import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter, Route} from 'react-router-dom';

class Works extends React.Component {
  render(){
    return(
      <div className="">
        <h1>Works</h1>

        <div className="">
          <h2>Shodo</h2>
          <p>Hi, I'm Yu Ohno who works in nantoka-japan support team.</p>
          <BrowserRouter>
          <Route path={'/works/1'}  component={Works}/>
          <Route path={'/works/2'}  component={Works}/>
        </BrowserRouter>
        </div>



      </div>
    )
  }
}
export default Works;
